import { makeStyles } from "@mui/styles";
import { borderColor, borderRadius } from "@mui/system";


export const useStyles = makeStyles({
  getStarted:{
    display:'flex'
  },
  inputDiv:{

    '& *':{
      border:0,
      height: '78px',
    }
  },
  buttonDiv:{
    '& button':{
      height: '70px',
      fontFamily: 'Roboto',
      fontSize: '18px',
      fontStyle: 'normal',
      fontWeight: '400',
      lineHeight: '24px',
      letterSpacing: '0em',
      textAlign: 'center',
      borderRadius:"0 50% 50% 0",
      backgroundColor:"#415AFF",
      border:0
    }
  }


})
